import React from 'react';
import New from './New';
import Share from './Share';
import DowloadVideo from './DowloadVideo';
import Financial from './Financial';

function Investors() {
  return (
    <div>
      <New />
      <Share />
      <DowloadVideo />
      <Financial />
    </div>
  );
}
export default Investors;
